import React from 'react';
import Home from './Pages/Home';
import './App.css';
import Login from "./Pages/Login";


function App() {
  return (
    <div className="App">

    <Router>
      <Switch>
         <Route path="/" component={Home} exact />
         <Route path="/Login" component={Login} />
      </Switch>
    </Router>

    </div>
  );
}

export default App;
